import React, {useState, useEffect}from "react";
import axios from "axios";
import './Body.css';
import DoctorDetails from "../../components/DoctorDetails.js";


function Body(props)
{

  const {data} = props;


    return (
      <div>
        {/* <img src="slides/pic10.jpg" className="bodyImage"></img> */}
        {data.map((pre) => (
          <div class="card">
          
         
              <img
                src={pre.image}
                class="card-img-top"
                alt="doctor photo"
                key={pre._id}
              ></img>
            <div class="card-body">
              <h1 class="card-title" key={pre._id}>
                {pre.name}
              </h1>
              <h3 class="card-text" key={pre._id}>
                {pre.specialization}
              </h3>
              <p class="card-text">
                <small class="text-muted" key={pre._id}>
                  {pre.experience}
                </small>
              </p>
            </div>
          </div>
        ))}
      </div>
    );
}
export default Body;
